import {Component} from '@angular/core';
import {MenuItem} from 'primeng/api';
import {Router, RouterModule} from '@angular/router';
import {CommonModule} from '@angular/common';
import {StyleClassModule} from 'primeng/styleclass';
import {AppConfigurator} from './app.configurator';
import {LayoutService} from '../service/layout.service';
import {AuthService} from "../../pages/auth/auth.service";

@Component({
    selector: 'app-topbar',
    standalone: true,
    imports: [RouterModule, CommonModule, StyleClassModule, AppConfigurator],
    styles: `/* topbar.component.css */
    .layout-topbar {
        //background: #008835;
        //color: white;
    }
    `,
    template: `
        <div class="layout-topbar">
            <div class="layout-topbar-logo-container">
                <button class="layout-menu-button layout-topbar-action"
                        (click)="layoutService.onMenuToggle()">
                    <i class="pi pi-bars"></i>
                </button>
                <a class="layout-topbar-logo" routerLink="/">
                    <svg xmlns="http://www.w3.org/2000/svg"
                         xmlns:xlink="http://www.w3.org/1999/xlink"
                         width="200px" height="200px" viewBox="0 0 200 200">
                        <image x="0" y="0" width="200" height="200"
                               xlink:href="data:image/png;base64,"/>
                    </svg>
                    <span>Peña Bética Luis Bellver - Gilena</span>
                </a>
            </div>

            <div class="layout-topbar-actions">
                <div class="layout-config-menu">
                    <button type="button" class="layout-topbar-action" (click)="toggleDarkMode()">
                        <i [ngClass]="{ 'pi ': true, 'pi-moon': layoutService.isDarkTheme(), 'pi-sun': !layoutService.isDarkTheme() }"></i>
                    </button>
                    <div class="relative">
<!--                        <button-->
<!--                            class="layout-topbar-action layout-topbar-action-highlight"-->
<!--                            pStyleClass="@next"-->
<!--                            enterFromClass="hidden"-->
<!--                            enterActiveClass="animate-scalein"-->
<!--                            leaveToClass="hidden"-->
<!--                            leaveActiveClass="animate-fadeout"-->
<!--                            [hideOnOutsideClick]="true"-->
<!--                        >-->
<!--                            <i class="pi pi-palette"></i>-->
<!--                        </button>-->
                        <app-configurator/>
                    </div>
                </div>

                <button class="layout-topbar-menu-button layout-topbar-action" pStyleClass="@next"
                        enterFromClass="hidden" enterActiveClass="animate-scalein"
                        leaveToClass="hidden" leaveActiveClass="animate-fadeout"
                        [hideOnOutsideClick]="true">
                    <i class="pi pi-ellipsis-v"></i>
                </button>

                <div class="layout-topbar-menu hidden lg:block">
                    <div class="layout-topbar-menu-content">
                        <!--                        <button type="button" class="layout-topbar-action">-->
                        <!--                            <i class="pi pi-calendar"></i>-->
                        <!--                            <span>Calendar</span>-->
                        <!--                        </button>-->
                        <!--                        <button type="button" class="layout-topbar-action">-->
                        <!--                            <i class="pi pi-inbox"></i>-->
                        <!--                            <span>Messages</span>-->
                        <!--                        </button>-->
                        <button type="button" class="layout-topbar-action"
                                (click)="irCarnetSocio()">
                            <i class="pi pi-user"></i>
                            <span>Perfil</span>
                        </button>
                        <button type="button" class="layout-topbar-action"
                                (click)="logout()">
                            <i class="pi pi-sign-out"></i>
                            <span>Cerrar Sesión</span>
                        </button>
                    </div>
                </div>
            </div>
        </div>`
})
export class AppTopbar {
    items!: MenuItem[];

    constructor(
        public layoutService: LayoutService,
        private authService: AuthService,
        private router: Router
    ) {
    }

    toggleDarkMode() {
        this.layoutService.layoutConfig.update((state) => ({
            ...state,
            darkTheme: !state.darkTheme
        }));
    }

    irCarnetSocio(): void {
        this.router.navigate(['/carnet-socio']);
    }

    logout(): void {
        this.authService.logout();
        this.router.navigate(['/auth/login']);
    }
}
